privateNamesUnique-1 shows an error when attempting structural comparison (because classes with private names are nominally-typed). Is this what you had in mind?

```ts
// @strict: true
// @target es6

class A {
    #foo: number;
}

class B {
    #foo: number;
}

const b: A = new B();     // Error: Property #foo is missing
```

I looked at the tests for `private` modifier and didn't see examples with structural comparison. Would you be able to point me toward what you had in mind? Thanks for your help.

The privateNamesInGenericClasses tests were recommended by a TS team member. They are intended to show that we didn't mess up handling of generics. That is, that C<number> isn't assignable to C<string>, even though the private name is the same in this case.
